"use strict";function setCookieAccepted(){var d=new Date;d.setTime(d.getTime()+31536e6),document.cookie=`cookie-accept=true; expires=${d.toUTCString()}; path=/`}function isCookieAccepted(){const b=document.cookie.match("(^|;)\\s*cookie-accept\\s*=\\s*([^;]+)");return b?b.pop():""}window.addEventListener("load",(function(){if(!isCookieAccepted()){var id=Math.random().toString(36).substring(7);document.body.innerHTML+=`<div class="modal show top" id="${id}" tabindex="-1" role="dialog" aria-labelledby="${id}_lbl"\n      aria-hidden="true">\n      <div class="modal-dialog modal-frame modal-top" role="document">\n        <div class="modal-content">\n          <div class="modal-body pt-0 pb-0">\n            <div class="row d-flex justify-content-center align-items-center">\n              <p class="pt-2 pr-2 pl-2 mb-0 pb-2">\n                abspacken3000.de nutzt Cookies zum Betrieb dieser Seite. <a href="privacy/" target="_blank">Weitere Infos</a></p>\n              <button type="button" class="btn btn-green btn-sm" onclick="document.getElementById('${id}').remove();setCookieAccepted();">Ok</button>\n            </div></div></div></div></div>`,$("#"+id).modal("show"),$(".modal-backdrop").removeClass("modal-backdrop")}}));